import Mathlib

def is_nonabelian (G : Type*) [Group G] : Prop :=
  ∃ (a b : G), a * b ≠ b * a

def order (G : Type*) [Group G] : ℕ :=
  Nat.choose (Nat.card G)

def s_3 : Type* := Equiv.Perm (Fin 3)

def is_s_3 (G : Type*) [Group G] : Prop :=
  G ≃* s_3

theorem autoformalized_theorem_1740 (G : Type*) [Group G] (hG : is_nonabelian G)
    (hG' : order G = 6) : is_s_3 G := by sorry

